import React from 'react';
import '../App.css';
import Grid from '@mui/material/Grid';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import {
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
  ListItemButton,
} from '@mui/material';
import { styled, useTheme } from '@mui/system';
import { createTheme } from '@mui/material/styles';

const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center',
  cursor: 'pointer',
});

const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
});

const PurchaseItem = styled('ul')({
  display: 'flex',
  height: '110px',
  padding: '10px 0',
  borderBottom: '1px solid #e8e5df',

})

function Contact({ token, setTokenFunction }) {
  return <>
  <Grid
    sx={{
      flexGrow: 1, height: "800px",
      px: { xs: "10px", sm: "25px", md: "100px", lg: "150px", xl: "200px" }
    }}
    container spacing={2}
  >
    <Grid item xs={8}>
      <Typography sx={{ fontSize: "1rem", color: "#a7a396" }}>
        Step <b>3</b> of <b>3</b>
      </Typography>
      <Typography sx={{ fontSize: "2rem", fontWeight: "500" }}>
        Checkout and Summary
      </Typography>
      <Box sx={{ height: "80%", position: "relative" }}>
        <div className='cart-item-headers' style={{ display: "flex", flexDirection: "row", width: "100%" }}>
          <div className="cart-item-column" style={{ marginLeft: "100px", width: "60%" }}>
            ITEM
          </div>
          <div className="cart-total-column" style={{ width: "40%", textAlign: "center" }}>
            TOTAL
          </div>
        </div>
      </Box>
    </Grid>
    <Grid item xs={4}>
      <Typography id="empty-spacer1" sx={{ fontSize: "1rem", color: "#a7a396" }}>
        &nbsp;
      </Typography>
      <Typography id="empty-spacer2" sx={{ fontSize: "2rem", fontWeight: "500" }}>
        &nbsp;
      </Typography>
      <Box sx={{ height: "80%", position: "relative" }}>

      </Box>
    </Grid>
  </Grid>
  </>
}

export default Contact;
